A common pattern is to declare a GraphQL interface and to implement it in a type, but you need to rewrite all the fields in the type that belong to the interface as they are not implicit. You can use the spread operator also with interfaces: Open in sandbox Source GraphQXL Compiled GraphQL interface Person { parent: String! childs: [String!]!
} type Dad implements Person { ...Person job_title: String!
} type Kid implements Person { ...Person school_name: String!
} interface Person { parent: String! childs: [String!]!
} type Dad implements Person { parent: String! childs: [String!]! job_title: String!
} type Kid implements Person { parent: String! childs: [String!]! school_name: String!
}

