The Optional modifier takes a type or an input as a parameter and outputs a similar object with all its fields marked as "nullable". If the field in the original object was declared required with a ! the output will contain that field without the !, otherwise the field is left untouched. Open in sandbox Source GraphQXL Compiled GraphQL type _SomeType { foo: String! bar: Int! bool: [Float!]
} type OptionalType = Optional<_SomeType> type OptionalType { foo: String bar: Int bool: [Float!]
}

