The Required modifier takes a type or an input as a parameter and outputs a similar object with all its fields marked as "non-nullable". If a field in the original object did not have a !, it will have it in the new object, otherwise it will be left untouched Open in sandbox Source GraphQXL Compiled GraphQL type _SomeType { foo: String bar: Int bool: [Float]!
} type RequiredType = Required<_SomeType> type RequiredType { foo: String! bar: Int! bool: [Float]!
}

