Let's say that you have a type that you want to reuse in other types: Source GraphQXL Compiled GraphQL type _ToBeReused { "Field foo from type 'ToBeReused'" foo: String!
} input Bar { ..._ToBeReused
} input Bar { "Field foo from type 'ToBeReused'" foo: String!
} There, foo's description says that the field foo belongs to the type ToBeReused, but once that is compiled it is not true, it should say something like: input Bar { "Field foo from input 'Bar'" foo: String!
}

