You can use template variables in the description strings to refer to some contextual values: Open in sandbox Source GraphQXL Compiled GraphQL type _ToBeReused { "Field foo from ${{ block.type }} '${{ block.name }}'" foo: String!
} input Bar { ..._ToBeReused
} type Baz { ..._ToBeReused
} input Bar { "Field foo from input 'Bar'" foo: String!
} type Baz { "Field foo from type 'Baz'" foo: String!
} These are the available values for the templates: block.name : The parent's block name block.type : The parent's block type (type or input) variables.YOUR_GENERIC_VARIABLE : The value of the generic variable once instanced

