GraphQXL is just a compiler that will receive .graphqxl files as an input and will compile them down to a common .graphql file. For example, given this foo.graphqxl file: # foo.graphqxl
type MyType { foo: String
} You can do graphqxl foo.graphqxl And the file will get compiled to foo.graphql: # foo.graphql
type MyType { foo: String
}

