types and inputs can inherit fields from other types and inputs using spread operators, for example: Open in sandbox Source GraphQXL Compiled GraphQL type Common { "Type's ID" id: ID! "Type's Name" name: String! "Type's description" description: String!
} type Product { ...Common "Product's price" price: Float!
} type Common { "Type's ID" id: ID! "Type's Name" name: String! "Type's description" description: String!
} type Product { "Type's ID" id: ID! "Type's Name" name: String! "Type's description" description: String! "Product's price" price: Float!
}

