It is very common that you do not want to expose the Common type in the public API, so you can make it private by prefixing the name with a _ character (or the prefix that you provide in the CLI argument): Open in sandbox Source GraphQXL Compiled GraphQL type _Common { "Type's ID" id: ID! "Type's Name" name: String! "Type's description" description: String!
} type Product { ..._Common "Product's price" price: Float!
} type Product { "Type's ID" id: ID! "Type's Name" name: String! "Type's description" description: String! "Product's price" price: Float!
}
